// ProfileModal.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ProfileModal({ isOpen, onClose, initialData, onUpdateSuccess }) {
    const [formData, setFormData] = useState({
        first_name: '',
        last_name: '',
        age: '',
        country_id: '',
        city_id: '',
    });
    const [countries, setCountries] = useState([]);
    const [cities, setCities] = useState([]);

    useEffect(() => {
        if (initialData) {
            setFormData({
                first_name: initialData.first_name,
                last_name: initialData.last_name,
                age: initialData.age,
                country_id: initialData.country_id || '',
                city_id: initialData.city_id || '',
            });
        }
    }, [initialData]);

    useEffect(() => {
        const fetchCountries = async () => {
            try {
                const response = await axios.get('http://localhost:8000/api/countries');
                setCountries(response.data); // Assuming response.data is an array of countries
            } catch (error) {
                console.error('Error fetching countries:', error);
            }
        };

        fetchCountries();
    }, []);

    const fetchCities = async (countryId) => {
        try {
            const response = await axios.get(`http://localhost:8000/api/cities/${countryId}`);
            setCities(response.data); // Assuming response.data is an array of cities for the given country
        } catch (error) {
            console.error('Error fetching cities:', error);
        }
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
        if (name === 'country_id') {
            setFormData({ ...formData, city_id: '' }); // Reset city selection when country changes
            fetchCities(value); // Fetch cities for the selected country
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:8000/api/update-student-info', formData, {
                withCredentials: true,
            });
            console.log(response.data);
            if (response.data.success) {
                onUpdateSuccess(); // Fetch updated data after successful update
                onClose(); // Close modal
            } else {
                // Handle error from server if needed
            }
        } catch (error) {
            console.error('Error updating profile:', error);
            // Handle network or other errors
        }
    };

    return (
        <div className={`modal ${isOpen ? 'open' : ''}`}>
            <div className="modal-content">
                <span className="close-btn" onClick={onClose}>&times;</span>
                <h2>Edit Profile</h2>
                <form onSubmit={handleSubmit}>
                    <label>First Name:
                        <input type="text" name="first_name" value={formData.first_name} onChange={handleChange} />
                    </label>
                    <label>Last Name:
                        <input type="text" name="last_name" value={formData.last_name} onChange={handleChange} />
                    </label>
                    <label>Age:
                        <input type="number" name="age" value={formData.age} onChange={handleChange} />
                    </label>
                    <label>Country:
                        <select name="country_id" value={formData.country_id} onChange={handleChange}>
                            <option value="">Select Country</option>
                            {Array.isArray(countries) && countries.length > 0 ? (
                                countries.map(country => (
                                    <option key={country.country_id} value={country.country_id}>
                                        {country.country_name}
                                    </option>
                                ))
                            ) : (
                                <option value="">No countries available</option>
                            )}
                        </select>
                    </label>
                    <label>City:
                        <select name="city_id" value={formData.city_id} onChange={handleChange}>
                            <option value="">Select City</option>
                            {Array.isArray(cities) && cities.length > 0 ? (
                                cities.map(city => (
                                    <option key={city.city_id} value={city.city_id}>
                                        {city.city_name}
                                    </option>
                                ))
                            ) : (
                                <option value="">No cities available</option>
                            )}
                        </select>
                    </label>
                    <button type="submit">Save Changes</button>
                </form>
            </div>
        </div>
    );
}

export default ProfileModal;
